import { Box, Button, Flex, Stack, Text } from "@chakra-ui/react";

function Home(){

    return (
        <div>
            <div>
           <Flex gap={5}>
                <Text fontSize='1xl'>Why Harvest?</Text>
                <Text fontSize='2xl'>Features</Text>
                <Text fontSize='2xl'>Customes</Text>
                <Text fontSize='1.3rem'>Integrations</Text>
                <Text fontSize='1.3rem'>Pricing</Text>
           </Flex>
            </div>
            <Box>
            <Button colorScheme='blue'>Button</Button>
            </Box>
        </div>
    )
}

export default Home;
